import React from "react" ;
import Topbar from "../../components/Topbar/Topbar";
import "./placements.css"
function Pplacements(){
    return (
        <div>
        <div><Topbar /></div>
            <div class="body">
                <h1>Hello</h1>
            </div>    
        </div>
    );
}
function Placements(){
    return(
        <>
        
        <placementsBody />
        
        </>

    );
}
export default Placements;
